// components/Sidebar.jsx
import React from 'react';

const Sidebar = () => {
  return (
    <div className="space-y-4">
      {/* Actions */}
      <div className="bg-white rounded-lg shadow border border-gray-200 p-4">
        <div className="flex items-center justify-between mb-2">
          <h2 className="font-semibold text-sm">Actions</h2>
          <span className="bg-blue-600 text-white text-xs px-2 py-0.5 rounded-full">2</span>
        </div>
        <ul className="text-sm space-y-1 text-gray-700">
          <li>Manage case log</li>
          <li>Manage your invoices</li>
        </ul>
      </div>

      {/* Communications */}
      <div className="bg-white rounded-lg shadow border border-gray-200 p-4">
        <h2 className="font-semibold text-sm mb-2">Communications</h2>
        <div className="text-sm text-gray-800">
          <p className="font-medium">Battery compliance update for vendor-fulfilled product listings</p>
          <p className="text-xs text-gray-500 mt-1">Jun 26, 2025</p>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
